import React, { useEffect, useState } from "react";
import { getProvider, getMyNFTs, getEthBalance } from "../contractUtils";
import Navbar from "./Navbar";

export default function Inventory({ onLogout }) {
  const [address, setAddress] = useState(null);
  const [cars, setCars] = useState([]);
  const [houses, setHouses] = useState([]);
  const [balance, setBalance] = useState("0");
  const [search, setSearch] = useState("");
  const [filteredHouses, setFilteredHouses] = useState([]);
  const [filteredCars, setFilteredCars] = useState([]);

  // Fetch properties on mount
  useEffect(() => {
    async function fetchData() {
      const provider = await getProvider();
      const signer = provider.getSigner();
      const userAddress = await signer.getAddress();
      setAddress(userAddress);
      const nfts = await getMyNFTs(userAddress);
      setCars(nfts.filter(nft => nft.itemType === "car"));
      setHouses(nfts.filter(nft => nft.itemType === "house"));
      setFilteredCars(nfts.filter(nft => nft.itemType === "car"));
      setFilteredHouses(nfts.filter(nft => nft.itemType === "house"));
      if (userAddress && typeof userAddress === "string" && userAddress.startsWith("0x") && userAddress.length === 42) {
        setBalance(await getEthBalance(userAddress));
      }
    }
    fetchData();
  }, []);

  // Search function
  function handleSearch(e) {
    e.preventDefault();
    const s = search.trim().toLowerCase();
    if (!s) {
      setFilteredHouses(houses);
      setFilteredCars(cars);
      return;
    }
    setFilteredHouses(
      houses.filter(nft =>
        nft.name.toLowerCase().includes(s) ||
        (nft.addr && nft.addr.toLowerCase().includes(s))
      )
    );
    setFilteredCars(
      cars.filter(nft =>
        nft.name.toLowerCase().includes(s) ||
        (nft.vin && nft.vin.toLowerCase().includes(s))
      )
    );
  }

  // Keep filtered lists up to date if user clears the search box
  useEffect(() => {
    if (search === "") {
      setFilteredHouses(houses);
      setFilteredCars(cars);
    }
  }, [search, houses, cars]);

  return (
    <div>
      <Navbar onLogout={onLogout} />
      <div className="main-content">
        <form style={{ display: "flex", gap: 7, marginBottom: 35, justifyContent: "flex-end" }} onSubmit={handleSearch}>
          <input
            type="text"
            placeholder="Search..."
            value={search}
            style={{
              border: "1.3px solid #d1d5db",
              borderRadius: 7,
              fontSize: 16,
              padding: "7px 12px"
            }}
            onChange={e => setSearch(e.target.value)}
          />
          <button
            type="submit"
            style={{
              background: "linear-gradient(90deg, #6366f1 70%, #5eead4 130%)",
              color: "#fff",
              fontWeight: 700,
              border: "none",
              borderRadius: 7,
              fontSize: 15,
              padding: "7px 16px",
              cursor: "pointer"
            }}
          >
            SEARCH
          </button>
        </form>
        <h1>Your Properties</h1>
        <div style={{ marginBottom: 34, fontSize: 15, color: "#666" }}>
          View your owned houses and cars below. Use the Transfer tab to send an item.
        </div>
        <div>
          <div style={{ fontWeight: "bold", fontSize: 18, marginBottom: 10 }}>Houses</div>
          <div style={{ display: "flex", gap: 32, flexWrap: "wrap" }}>
            {filteredHouses.length === 0 && <span>No houses found.</span>}
            {filteredHouses.map((nft) => (
              <div key={nft.tokenId} className="asset-card">
                <div className="asset-type">🏠</div>
                <div className="asset-title">{nft.name}</div>
                <div className="asset-detail">Worth: ${nft.value}</div>
                <div className="asset-detail">Purchased: {nft.purchaseDate}</div>
                <div className="asset-detail">Address: {nft.addr}</div>
                <div style={{ fontSize: 12, color: "#888" }}>NFT ID: {nft.tokenId}</div>
              </div>
            ))}
          </div>
        </div>
        <div style={{ fontWeight: "bold", fontSize: 18, margin: "30px 0 10px 0" }}>Cars</div>
        <div style={{ display: "flex", gap: 32, flexWrap: "wrap" }}>
          {filteredCars.length === 0 && <span>No cars found.</span>}
          {filteredCars.map((nft) => (
            <div key={nft.tokenId} className="asset-card">
              <div className="asset-type">🚗</div>
              <div className="asset-title">{nft.name}</div>
              <div className="asset-detail">Worth: ${nft.value}</div>
              <div className="asset-detail">Purchased: {nft.purchaseDate}</div>
              <div className="asset-detail">VIN: {nft.vin}</div>
              <div style={{ fontSize: 12, color: "#888" }}>NFT ID: {nft.tokenId}</div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
